        </>
    )
}


const Feed = () => {
    return (
        <div className="feed">
            <div className="feed__story">
                <Profile_story image={ NoPictureLogo } username="manish" />
                <Profile_story image={ NoPictureLogo } username="mariya" />
                <Profile_story image={ NoPictureLogo } username="divyanshu" />
                <Profile_story image={ NoPictureLogo } username="manishmalhotra" />
                <Profile_story image={ NoPictureLogo } username="to_the_moon" />
                <Profile_story image={ NoPictureLogo } username="hellothisisexpiriman" />
            </div>
            <div className="feed__post">

            </div>
        </div>
    )
}

export default Feed
